import React from 'react';
import {H1, SmallContainer, ParallaxBackground} from '../components'
import ironManPoster from '../assets/ironManPoster.jpg'

class Card extends React.Component {
	render() {
		return(
	    	<SmallContainer width='240px' height='350px' background={this.props.background} marginright='20px' margintop='20px'>
	    		<ParallaxBackground height='100%' src={ironManPoster} />
    			<SmallContainer className='child'>
		    		<H1>{this.props.movieName} ({this.props.releaseDate})</H1>			    				    				
    			</SmallContainer>	    			
	    	</SmallContainer>		    				    
		)
	;}
}

export default Card;
